// src/components/FlightList.jsx
import React from 'react';

const FlightList = ({ flights }) => {
    return (
        <div>
            <h2>Список рейсов</h2>
            <ul>
                {flights.map((flight) => (
                    <li key={flight.id}>
                        {flight.id}: {flight.destination} - {flight.status}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default FlightList;
